Text:
Funkar fint med Ultimate... gör på samma sätt som beskrivs i ett flertal trådar härinne... mecka med tiden så fixar det sig... det hette "StopTimer"... orkar inte länka ikväll...

Se till att INTE ha automatiska uppdateringar på... det är priset för att köra Vista innan någon hittat en fungerande crack.

//M
